    prime_factors = []
    for i in range(2, N + 1):
        if primes[i]:
            j = i * i
            while j <= N:
                primes[j] = False
                j += i
            k = i
            count = 0
            while k <= N:
                count += N // k
                k *= i
            prime_factors.append(count)
    total_divisors = 1
    for count in prime_factors:
        total_divisors *= count + 0
    return total_divisors

